function WithSubscription() {
    return (
      <div className="subscribe hidden">
        <div className="subscribe-container">
          <div className="subscribe--main">
            <div className="subscribe-container-item"></div>
            <div className="subscribe-container-item">
              <label htmlFor="" className="subscribe-label">
                Mobile
              </label>
            </div>
            <div className="subscribe-container-item">
              <label htmlFor="" className="subscribe-label">
                Premium HD
              </label>
            </div>
          </div>
          <hr />
  
          <div className="subscribe--main">
            <div className="subscribe-container-item">
              <label htmlFor="" className="subscribe-label">
                Premium content
              </label>
            </div>
            <div className="subscribe-container-item">
              <label htmlFor="" className="subscribe-label">
                {" "}
                ✓
              </label>
            </div>
            <div className="subscribe-container-item">
              <label htmlFor="" className="subscribe-label">
                ✓
              </label>
            </div>
          </div>
          <hr />
  
          <div className="subscribe--main">
            <div className="subscribe-container-item">
              <label htmlFor="" className="subscribe-label">
                Ad-free
              </label>
            </div>
            <div className="subscribe-container-item">
              <label htmlFor="" className="subscribe-label">
                ✓
              </label>
            </div>
            <div className="subscribe-container-item">
              <label htmlFor="" className="subscribe-label">
                ✓
              </label>
            </div>
          </div>
          <hr />
  
          <div className="subscribe--main">
            <div className="subscribe-container-item">
              <label htmlFor="" className="subscribe-label">
                Device
              </label>
            </div>
            <div className="subscribe-container-item">
              <label htmlFor="" className="subscribe-label">
                ✓
              </label>
            </div>
            <div className="subscribe-container-item">
              <label htmlFor="" className="subscribe-label">
                ✓
              </label>
            </div>
          </div>
          <hr />
  
          <div className="subscribe--main">
            <div className="subscribe-container-item">
              <label htmlFor="" className="subscribe-label">
                No. of screens
              </label>
            </div>
            <div className="subscribe-container-item">
              <label htmlFor="" className="subscribe-label">
                1
              </label>
            </div>
            <div className="subscribe-container-item">
              <label htmlFor="">2</label>
            </div>
          </div>
  
          <div className="subscribe-msg">
            <p>You have subscribed Zee5. Please enjoy the subscription.</p>
          </div>
        </div>
      </div>
    );
  };
export default WithSubscription;
